 @criscris9609  
So if you’re familiar with Twitch, they have a Raid system, where you send a group of people over to another streamer and spam “X RAID” to let them know. It’s built into their system. YouTube doesn’t, however, and Hololive vtubers have a rule stating not to mention another streamer unless the streamer themselves do, which raids break. So last night, Gura sent over her members to Ame’s chat, and asked them to be polite and not disturb Ame’s chat. They weren’t. They spammed Ame’s chat with “GURA RAID” and made the chat unbearable for interaction. People also broke another rule in response where if there is spamming, you’re supposed to report and ignore it. Well people started policing chat, and what followed was a massive wall of spam that didn’t even do with Ame, it was with Gura, and that lasted 30+ minutes according to some users.

Also, when Gura started her stream, some people left Ame’s by saying “Heading off to Gura’s stream!” and “Oh Gura is on, this stream’s gonna die in viewership” and other insensitive stuff like that. It was grossly childish and impolite.

 @AxcelTSX  I feel it's kinda hard to fault folks for the whole "raid" thing, since a lot of HoloEN fans, and particularly Gura's, are rather new to v-tubers and Hololive in general, and likely come from Twitch, where raids are not only are acceptable, it's heavily encouraged and even built into Twitch as a feature, since the idea behind it is for bigger channels to promote smaller ones. Twitch users and westerners in general see raiding as a positive, which is vastly different from Hololive culture, in which raiding is actually really rude. 

For those that need an explanation why that is and why Rule 4 is a thing: These girls are idols; they are supposed to be the star of their own stream. When Amelia's chat becomes about Gura, telling Ame to save Gura everytime she's in trouble, and announcing your departure and arrival to her stream based on Gura being live or not, that's not fair to Amelia, since she's no longer the star of her own stream, and when one ends up being sidelined in their own stream, they might be inclined feel that they weren't good enough as an idol.

I get the West isn't quite so familiar with idol culture, and that the new fans are entering a new, unfamiliar territory and likely don't mean any harm in their actions, but to you new folks out there, try to remember that each girl is supposed to be the star of her own stream. Resist the urge to talk about others unless it's part of the current conversion she's having, and don't spam their chats about someone else entirely, since that's rude to both her and her fans. The Twitch stuff stays on Twitch.
